'''
calculate two private keys
'''
def expand_euclidean(fai, e):
    """拡張ユークリッド互除法"""
    if e == 0:
        u = 1
        v = 0
    else:
        q = fai / e
        r = fai % e
        (u0, v0) = expand_euclidean(e, r)
        u = v0
        v = u0 - q * v0
    return (u, v)


